import React, {useEffect, useState} from "react";

//components
import Grid from "./Grid";
import Header from "./Header";

//hooks
import useLogin from "../"


const Home = () => {
  const {playlists} = useLogin()

  return (
    <>
      <Header />
      <Grid playlists={playlists}
              />
    </>
  );
};

export default Home;
